-- webmaker-android user story (ADD-PHOTOS)
-- summary: discover -> make new project -> add 10 photos to a page

-- user agent: android version >= 41
http.set_user_agent_string("Mozilla/5.0 (Android 4.4; Mobile; rv:41.0) Gecko/41.0 Firefox/41.0")

local request_headers = {
  authorization="token thisisatokenthatisnotrealsoyoucantuseitprovideyourown",
  ["Content-Type"]="application/json"
}
local base_url = "https://webmaker-api.herokuapp.com"
local user_path = "/users/884"
local sleeptime  = 45

-- visit discover page
http.request_batch({
    {
      "GET",
      base_url .. "/discover",
      response_body_bytes=10240
    }
  }
)

client.sleep(sleeptime)

-- make a new project
local response = http.request_batch({
  {
    "POST",
    base_url .. user_path .. "/projects",
    headers=request_headers,
    data=json.stringify({
      title="test project name"
    }),
    response_body_bytes=10240
  }
})

client.sleep(sleeptime)

-- parse response to get page URL
response = json.parse(response[1]["body"])
local project_id = response.project.id
local project_path = "/projects/" .. project_id
local page_url = base_url .. user_path .. project_path .. "/pages"

-- request project pages 
http.request_batch({
  {
    "GET",
    page_url,
  }
})

client.sleep(100)

-- make a page
response = http.request_batch({
  {
    "POST",
    page_url,
    headers=request_headers,
    data=json.stringify({
      x=1,
      y=0,
      styles=json.stringify({
        backgroundColor="#f2f6fc"
      })
    }),
    response_body_bytes=10240
  }
})

response = json.parse(response[1]["body"])
local page_id = response.page.id
local page_path = "/pages/" .. page_id
local element_url = base_url .. user_path .. project_path .. page_path .. "/elements"

-- array of 10 64-bit encoded images
local images = {
""
}

-- utility to make a blank page for a single user's project
function add_image(n)
  local response = http.request_batch({
      {
        "POST",
        element_url,
        headers = request_headers,
        data = json.stringify({
            attributes = {
                img = images[n]
              }
        }),
        response_body_bytes = 10240
      }
  })
    
    client.sleep(sleeptime)
  
    return response
end

-- add 7 images
for i=1,7 do add_image(i) end
